import React from 'react';
import { BrowserRouter as Router, Switch, Route, Link } from 'react-router-dom';
import ArmorPage from './ArmorPage';
import CaryllRunesPage from './CaryllRunesPage';
import HunterToolsPage from './HunterToolsPage';
import WeaponsPage from './WeaponsPage';
import './App.css';

function App() {
  return (
    <Router>
      <div className="App">
        <header className="App-header">
          <h1>Bloodborne Wiki</h1>
        </header>
        <div className="content">
          <div className="links">
            <Link to="/armor-type">Armor</Link>
            <Link to="/caryll-runes">Caryll Runes</Link>
            <Link to="/hunter-tools">Hunter Tools</Link>
            <Link to="/weapon-type">Weapons</Link>
          </div>
        </div>
        <Switch>
          <Route path="/armor-type">
            <ArmorTypePage />
          </Route>
          <Route path="/caryll-runes">
            <CaryllRunesPage />
          </Route>
          <Route path="/hunter-tools">
            <HunterToolsPage />
          </Route>
          <Route path="/weapon-type">
            <WeaponTypePage />
          </Route>
        </Switch>
      </div>
    </Router>
  );
}

export default App;
